import React from 'react'

function App(){
    return (
        <>
                <h1>Hello Lathesh</h1>
            <h2>This is my world</h2>
            <ul>
            <li>Lathesh</li>
            <li>Manju</li>
            <li>Raaki</li>
            <li>Navin</li>
        </ul>
        </>
    
    );
}

export default App;
